{'slug': 'hugh-logan', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': "This kea is one of many new fledglings seen during the 2019 winter months which have appeared as part of a second clutch in what has been an unusually prolific breeding season.

