{'slug': 'adriana', 'status': 'Alive', 'sex': 'Female', 'bird_extended': {'description': "Two kea were caught together at Red Tarns on the slopes of Mt Sebastapol in mid-March 2019. These two young birds, most likely brother and sister, were named Scotty and Adriana after a wonderful couple from the area who have been heavily involved in conservation for many years. 

Scott Theobold died tragically in a helicopter accident in Oct 2018, along with two others (Paul Hondelink and pilot Nick Wallis). We dedicate this to Scotty, Adriana and their family and recognise that what Scott has achieved in conservation progress has been tremendous. His work includes pioneering the use of predator detection dogs in NZ. His first work was training dogs to detect stoats - one of the kea's biggest predators. 

Adriana came to help out with some kea catching with us and Corey Mosen (the kea guru) at Red Tarns a year or so back, and was one of the most wonderful, enthusiastic, positive people you will ever meet. Our thoughts and best wishes are with Adriana and family and long may you continue with your good work. Kia kaha.", 'is_featured': False, 'sponsor_name': None, 'sponsor_website': None, 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/adriana/Two_kea_on_rock_Aoraki-crop-c0-5__0-5-500x500-70.jpg', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/adriana/Two_kea_on_rock_Aoraki-crop-c0-5__0-5-350x250-70.jpg', 'full_size': 'https://media.keadatabase.nz/media/birds/adriana/Two_kea_on_rock_Aoraki.jpg'}, 'profile_picture_attribution': 'Clio Reid'}, 'get_age': 0, 'get_life_stage': 'Fledgling', 'study_area': 'Aoraki', 'band_combo': 'White C on Orange', 'name': 'Adriana', 'birthday': '2019-01-01', 'primary_band': 'V-2103', 'date_modified': '2019-04-17T15:21:43.226481+12:00', 'date_imported': '2019-04-17T15:21:42+12:00'}

