{'slug': 'lancelot', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': "Lancelot is a handsome adult male kea who frequently visits Arthur's Pass village. He seems to have lost his plastic leg bands and now just has a single metal band on his right leg with the number V-1696. So, if you see an adult male with a single metal band on his right leg hanging around the Store or the village, it's likely to be this guy - Lancelot! 

Taking photos? Zoom in and try to get a reading in the number on this band so we can confirm whether it's him or not. 

Lancelot is at least 7 years of age, but probably older. Did you know that kea can live to at least 50 years old? The oldest known wild kea are at least 25 years old but in captivity there is one kea who is 51 years old (as of 2017).", 'is_featured': False, 'sponsor_name': None, 'sponsor_website': None, 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/lancelot/lancelot-crop-c0-5__0-5-500x500-70.jpg', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/lancelot/lancelot-crop-c0-5__0-5-350x250-70.jpg', 'full_size': 'https://media.keadatabase.nz/media/birds/lancelot/lancelot.jpg'}, 'profile_picture_attribution': 'Kate Costello'}, 'get_age': 9, 'get_life_stage': 'Adult', 'study_area': 'Waimakariri', 'band_combo': 'Black W on Green', 'name': 'Lancelot', 'birthday': '2010-01-01', 'primary_band': 'V-1696', 'date_modified': '2018-06-18T14:35:00.730896+12:00', 'date_imported': '2017-06-28T00:21:19.813955+12:00'}

{'slug': 'lulu', 'status': 'Alive', 'sex': 'Female', 'bird_extended': {'description': "'Lulu' - a lovely name for a beautlful female kea. Sue Streatfield who works for DOC organised a kea banding trip with us in March 2019 to understand the kea population along the Milford Highway sites and how we can get better advocacy and conservation work to happen in this area.

Sue named this wonderful kea 'Lulu' after their old, much-loved rescue dog who is now 13. Lulu is bird, human, dog and cat friendly. Sue and her partner Toby often reflect on how parrots live for so long (20-30 years) and dogs only half that. 

Did you know that the oldest kea in captivity is over 50 years old, while the oldest kea we know of from the wild was at least 20?", 'is_featured': False, 'sponsor_name': None, 'sponsor_website': None, 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/lulu/TobyMansonPhoto_Kea_MilfordSound-2017-keaflying-crop-c0-5__0-5-500x500-70.jpg', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/lulu/TobyMansonPhoto_Kea_MilfordSound-2017-keaflying-crop-c0-5__0-5-350x250-70.jpg', 'full_size': 'https://media.keadatabase.nz/media/birds/lulu/TobyMansonPhoto_Kea_MilfordSound-2017-keaflying.jpg'}, 'profile_picture_attribution': 'Toby Manson'}, 'get_age': 0, 'get_life_stage': 'Fledgling', 'study_area': 'Fiordland', 'band_combo': 'Yellow Y on Black', 'name': 'Lulu', 'birthday': '2019-01-01', 'primary_band': 'V-1358', 'date_modified': '2019-04-23T00:49:30.535874+12:00', 'date_imported': '2019-04-23T00:49:29+12:00'}

{'slug': 'waiti', 'status': 'Dead', 'sex': 'Female', 'bird_extended': {'description': "UPDATE: May 4th 2019 - devastating news, little Waiti was found dead behind a house in central Arthur's Pass village. Her cause of death is still unknown, though it looks like she has been ravaged by a predator. Her body has been sent away for autopsy.

Waiti was banded as a fledgling in Arthur's Pass township by Laura and Martina in March 2018.

The children at Little Footsteps John Street Early Learning Centre Blenheim, were invited to name a kea. Ana, a wonderful teacher at the centre, used a kea puppet to introduce the kea and develop the concept of naming the kea. The tamariki were fascinated and many learnt for the first time about kea. They chose to name the female fledgling from Arthur’s Pass ‘Waiti’ after one of the stars of Matariki. They were inspired by a waiata that they had learnt for celebrating the Māori New Year.", 'is_featured': True, 'sponsor_name': 'Little Footsteps Quality Care and Education Centre', 'sponsor_website': 'http://littlefootsteps.co.nz', 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/waiti/Waiti-crop-c0-5__0-5-500x500-70.JPG', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/waiti/Waiti-crop-c0-5__0-5-350x250-70.JPG', 'full_size': 'https://media.keadatabase.nz/media/birds/waiti/Waiti.JPG'}, 'profile_picture_attribution': 'Mark Brabyn'}, 'get_age': None, 'get_life_stage': None, 'study_area': 'Waimakariri', 'band_combo': 'Black + on White', 'name': 'Waiti', 'birthday': '2018-01-01', 'primary_band': 'V-2302', 'date_modified': '2019-06-05T16:10:54.934220+12:00', 'date_imported': '2018-08-29T13:52:19+12:00'}

{'slug': 'irwin', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': "'Irwin' is named after the Wyn Irwin Lodge, owned and operated by the Canterbury Mountaineering Club at Aoraki/Mt Cook village. Cam Mulvey named this kea after the place (see also Irwin's sibling, 'Wyn'). Cam is essentially the guardian of this neck of the woods, keeps a good eye on the local kea and keeps us in the loop as to what's happening with the kea population here. He also takes wonderful photographs, especially of kea and mountains, and encourages other people to keep an eye on nature.

Mel from the VC is also on the job, keeping an eye on local kea, accumulating kea sightings from visitors to the area and entering them into the sightings database. How important it is to have locals keeping an eye on kea!

A lot of kea research went on in the area until about ten years ago. Researchers from Vienna, Austria spent a lot of time around Aoraki observing kea to gain a better understanding of their behavioural biology. Several PhD students from the University of Canterbury also spent time in the area researching the then reasonably plentiful kea population. Not a lot has happened since but hopefully things are about to change! With the beginnings of the kea sighting project kicking off in other areas where kea and humans interact, and the Kea Conservation Trust's lead removal project, there will be more work happening here. Watch this space.", 'is_featured': False, 'sponsor_name': None, 'sponsor_website': None, 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/irwin/Kea_flying_back_Aoraki-crop-c0-5__0-5-500x500-70.jpg', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/irwin/Kea_flying_back_Aoraki-crop-c0-5__0-5-350x250-70.jpg', 'full_size': 'https://media.keadatabase.nz/media/birds/irwin/Kea_flying_back_Aoraki.jpg'}, 'profile_picture_attribution': 'Cam Mulvey'}, 'get_age': 0, 'get_life_stage': 'Fledgling', 'study_area': 'Aoraki', 'band_combo': 'White X on Red', 'name': 'Irwin', 'birthday': '2019-01-01', 'primary_band': 'V-0524', 'date_modified': '2019-04-17T14:39:07.806052+12:00', 'date_imported': '2019-04-17T14:38:52+12:00'}

