{'slug': 'paul', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': "Paul the kea is an adult male who often frequents the cafe and various other locations around Arthur's Pass village. He often hangs out with Kauri (Black Y on Yellow band) and in 2017 spent some time in the Wildlife Hospital in Christchurch receiving chelation treatment for his lead poisoining. He has since recovered and has now been healthy and lead-free for over a year!

