{'slug': 'tenacious-d', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': 'The amazing team at Kingswood Skis have sponsored this delightful, placid young male kea:

Kingswood Skis is a handmade ski company based in Lyttelton. Kingswood owners and customers have seen the sharp decline in kea firsthand. These cheeky birds always played a starring role in the Canterbury club ski field experience - you learned quickly not to leave your gloves and goggles on the deck when you went into the hut for a cuppa! This year, we didn’t see a single kea at Mount Olympus. 

Kingswood decided to sponsor a kea and ask our community to help with sightings. We left the naming to our crowd! Tenacious D seems like a hopeful name for a declining species - and one  that we hope will spring to mind when you spot his tag.', 'is_featured': False, 'sponsor_name': 'Kingswood Skis', 'sponsor_website': 'https://www.kingswoodskis.com/', 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/tenacious-d/DSC_0158-crop-c0-5__0-5-500x500-70.JPG', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/tenacious-d/DSC_0158-crop-c0-5__0-5-350x250-70.JPG', 'full_size': 'https://media.keadatabase.nz/media/birds/tenacious-d/DSC_0158.JPG'}, 'profile_picture_attribution': 'L Young'}, 'get_age': 2, 'get_life_stage': 'Sub-Adult', 'study_area': 'Waimakariri', 'band_combo': 'White D on Pink', 'name': 'Tenacious D', 'birthday': '2017-01-01', 'primary_band': 'V-2612', 'date_modified': '2018-12-30T13:02:01.270773+13:00', 'date_imported': '2018-12-30T13:01:56+13:00'}

