{'slug': 'asher', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': "This adult male is often seen with a bunch of others around the village - the group consists mainly of adult males and fledgling and juvenile males with a couple of juvenile females. For much of the year we won't encounter adult females because they'll be away looking after eggs/chicks on the nest.

This kea is named after Asher—a boy who lives in Arthur's Pass village, in fact one of only four children that live there! Asher's mum and dad are highly active in conservation, are members of the Arthur's Pass Wildlife Trust and dedicate a lot of their time to trapping, weeding and APWT admin. They come and help out with kea conservation work whenever they can and Asher and his brother Kester (who also has a kea named after him) are learning all about kea conservation in their spare time. 

Arthur's Pass Wildlife Trust play a significant role in kea conservation and advocacy work as well as working hard to protect a range of other species.", 'is_featured': False, 'sponsor_name': "Arthur's Pass Wildlife Trust", 'sponsor_website': 'http://apwt.org.nz/', 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/asher/Grassland_kea-crop-c0-46__0-33-500x500-70.jpg', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/asher/Grassland_kea-crop-c0-46__0-33-350x250-70.jpg', 'full_size': 'https://media.keadatabase.nz/media/birds/asher/Grassland_kea.jpg'}, 'profile_picture_attribution': 'Laura Young'}, 'get_age': 6, 'get_life_stage': 'Adult', 'study_area': 'Waimakariri', 'band_combo': 'White A on Orange', 'name': 'Asher', 'birthday': '2013-01-01', 'primary_band': 'V-2614', 'date_modified': '2018-10-12T12:29:25.762032+13:00', 'date_imported': '2018-10-12T12:29:25+13:00'}

