{'slug': 'lancelot', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': "Lancelot is a handsome adult male kea who frequently visits Arthur's Pass village. He seems to have lost his plastic leg bands and now just has a single metal band on his right leg with the number V-1696. So, if you see an adult male with a single metal band on his right leg hanging around the Store or the village, it's likely to be this guy - Lancelot! 

