{'slug': 'gary-chisholm', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': 'Gary Chisholm was banded by Mark and Margaret at Porters ski field in September 2017 as a fledgling. He is almost certainly the offspring of Anthea who was seen with him at the time. 

