{'slug': 'phillipa', 'status': 'Alive', 'sex': 'Female', 'bird_extended': {'description': "This petite young female kea was found with a group of up to about 15 others in Arthur's Pass village - mostly consisting of males including fledglings, juveniles and adults. Kea are very active in the morning and evening.

Kea are the principle seed disperser for a range of fleshy fruited alpine plants. Because it was dark when we banded this kea, we've used this photo instead to illustrate the evidence of just how important kea are (through what they eat and how they poo) for alpine ecosystems!

The South Island Wildlife Hospital vets came up to help out in the field during the week and care for many of the sick kea. This little kea is named after one of the kea carers.", 'is_featured': False, 'sponsor_name': 'South Island Wildlife Hospital', 'sponsor_website': 'https://www.wildlifehospital.co.nz/', 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/phillipa/P1010389-crop-c0-5__0-5-500x500-70.JPG', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/phillipa/P1010389-crop-c0-5__0-5-350x250-70.JPG', 'full_size': 'https://media.keadatabase.nz/media/birds/phillipa/P1010389.JPG'}, 'profile_picture_attribution': 'Laura Young'}, 'get_age': 1, 'get_life_stage': 'Juvenile', 'study_area': 'Waimakariri', 'band_combo': 'Green J on Black', 'name': 'Phillipa', 'birthday': '2018-01-01', 'primary_band': 'V-2244', 'date_modified': '2018-09-06T16:22:14.445931+12:00', 'date_imported': '2018-09-06T16:22:09+12:00'}

