{'slug': 'lancelot', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': "Lancelot is a handsome adult male kea who frequently visits Arthur's Pass village. He seems to have lost his plastic leg bands and now just has a single metal band on his right leg with the number V-1696. So, if you see an adult male with a single metal band on his right leg hanging around the Store or the village, it's likely to be this guy - Lancelot! 

Taking photos? Zoom in and try to get a reading in the number on this band so we can confirm whether it's him or not. 

Lancelot is at least 7 years of age, but probably older. Did you know that kea can live to at least 50 years old? The oldest known wild kea are at least 25 years old but in captivity there is one kea who is 51 years old (as of 2017).", 'is_featured': False, 'sponsor_name': None, 'sponsor_website': None, 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/lancelot/lancelot-crop-c0-5__0-5-500x500-70.jpg', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/lancelot/lancelot-crop-c0-5__0-5-350x250-70.jpg', 'full_size': 'https://media.keadatabase.nz/media/birds/lancelot/lancelot.jpg'}, 'profile_picture_attribution': 'Kate Costello'}, 'get_age': 9, 'get_life_stage': 'Adult', 'study_area': 'Waimakariri', 'band_combo': 'Black W on Green', 'name': 'Lancelot', 'birthday': '2010-01-01', 'primary_band': 'V-1696', 'date_modified': '2018-06-18T14:35:00.730896+12:00', 'date_imported': '2017-06-28T00:21:19.813955+12:00'}

