{'slug': 'waiti', 'status': 'Dead', 'sex': 'Female', 'bird_extended': {'description': "UPDATE: May 4th 2019 - devastating news, little Waiti was found dead behind a house in central Arthur's Pass village. Her cause of death is still unknown, though it looks like she has been ravaged by a predator. Her body has been sent away for autopsy.

Waiti was banded as a fledgling in Arthur's Pass township by Laura and Martina in March 2018.

The children at Little Footsteps John Street Early Learning Centre Blenheim, were invited to name a kea. Ana, a wonderful teacher at the centre, used a kea puppet to introduce the kea and develop the concept of naming the kea. The tamariki were fascinated and many learnt for the first time about kea. They chose to name the female fledgling from Arthur’s Pass ‘Waiti’ after one of the stars of Matariki. They were inspired by a waiata that they had learnt for celebrating the Māori New Year.", 'is_featured': True, 'sponsor_name': 'Little Footsteps Quality Care and Education Centre', 'sponsor_website': 'http://littlefootsteps.co.nz', 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/waiti/Waiti-crop-c0-5__0-5-500x500-70.JPG', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/waiti/Waiti-crop-c0-5__0-5-350x250-70.JPG', 'full_size': 'https://media.keadatabase.nz/media/birds/waiti/Waiti.JPG'}, 'profile_picture_attribution': 'Mark Brabyn'}, 'get_age': None, 'get_life_stage': None, 'study_area': 'Waimakariri', 'band_combo': 'Black + on White', 'name': 'Waiti', 'birthday': '2018-01-01', 'primary_band': 'V-2302', 'date_modified': '2019-06-05T16:10:54.934220+12:00', 'date_imported': '2018-08-29T13:52:19+12:00'}

{'slug': 'vortex', 'status': 'Alive', 'sex': 'Female', 'bird_extended': {'description': "Vortex was banded in October 2017 as a fledgling. We can determine that she is a female by the length her top bill (less than 45mm) and size of her head (less than 65mm). She also weighs less than a male (800g compared with up to and over 1kg). 

Vortex was named and sponsored by Bremick Fasteners who provided discounted roofing screws (named Vortex screws) for an ongoing project to remove lead from buildings in Arthur's Pass township. 

Unfortunately young kea, with their inquisitive nature, will chew the old lead nails and roof flashings which tastes sweet to them. This results in them becoming very sick or dying. It is possible to treat lead poisoning, but requires a visit to the South Island Wildlife Hospital at Willowbank for three or more weeks of chelation treatment.", 'is_featured': False, 'sponsor_name': 'Bremick Fasteners', 'sponsor_website': 'http://bremick.co.nz/', 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/vortex/Vortex1-crop-c0-49__0-39-500x500-70.JPG', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/vortex/Vortex1-crop-c0-49__0-39-350x250-70.JPG', 'full_size': 'https://media.keadatabase.nz/media/birds/vortex/Vortex1.JPG'}, 'profile_picture_attribution': 'Mark Brabyn'}, 'get_age': 2, 'get_life_stage': 'Sub-Adult', 'study_area': 'Waimakariri', 'band_combo': 'White V on Brown', 'name': 'Vortex', 'birthday': '2017-01-01', 'primary_band': 'V-2525', 'date_modified': '2018-04-04T11:00:43.393965+12:00', 'date_imported': '2017-11-01T13:15:09+13:00'}

