{'slug': 'greenie', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': 'Greenie was named by the year 3 & 4 students of Waltham Primary School because keas are green and the students of the school are all “greenies”. The students can all relate to keas as they are also “intelligent, fun, mischievious, and a little bit cheeky”. 
Other top contenders for his name were James Cook, Waltham and Te Puni.

