{'slug': 'haurangi', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': 'Haurangi was banded as fledgling kea  on the summit of Avalanche Peak, Arthur's Pass National Park in March 2018 by Mark and Radomirlev from the Czech Republic.

Lyttleton Primary School was given the honour of naming this kea. The name Haurangi was put forward by the Raupo Class (years 5 & 6) and this was voted by the whole of the Rakanui group as the best name.

