{'slug': 'vortex', 'status': 'Alive', 'sex': 'Female', 'bird_extended': {'description': "Vortex was banded in October 2017 as a fledgling. We can determine that she is a female by the length her top bill (less than 45mm) and size of her head (less than 65mm). She also weighs less than a male (800g compared with up to and over 1kg). 

Vortex was named and sponsored by Bremick Fasteners who provided discounted roofing screws (named Vortex screws) for an ongoing project to remove lead from buildings in Arthur's Pass township. 

Unfortunately young kea, with their inquisitive nature, will chew the old lead nails and roof flashings which tastes sweet to them. This results in them becoming very sick or dying. It is possible to treat lead poisoning, but requires a visit to the South Island Wildlife Hospital at Willowbank for three or more weeks of chelation treatment.", 'is_featured': False, 'sponsor_name': 'Bremick Fasteners', 'sponsor_website': 'http://bremick.co.nz/', 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/vortex/Vortex1-crop-c0-49__0-39-500x500-70.JPG', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/vortex/Vortex1-crop-c0-49__0-39-350x250-70.JPG', 'full_size': 'https://media.keadatabase.nz/media/birds/vortex/Vortex1.JPG'}, 'profile_picture_attribution': 'Mark Brabyn'}, 'get_age': 2, 'get_life_stage': 'Sub-Adult', 'study_area': 'Waimakariri', 'band_combo': 'White V on Brown', 'name': 'Vortex', 'birthday': '2017-01-01', 'primary_band': 'V-2525', 'date_modified': '2018-04-04T11:00:43.393965+12:00', 'date_imported': '2017-11-01T13:15:09+13:00'}

