{'slug': 'aroha', 'status': 'Alive', 'sex': 'Female', 'bird_extended': {'description': "Aroha was banded by Laura Young during the kea summer survey in the Hawdon Valley in 2015. Because she was an adult female, a transmitter was attached so she could be followed (along with others in the valley) to understand what kea breeding success is like, what the threats to kea are and much more (ongoing work by DOC and KCT, carried out by the kea team).  In November 2015 Aroha's nest cavity was located. A trail camera was put outside her cavity but unfortunately the nest failed early on - almost certainly due to stoat predation. Aroha did not appear to nest in 2016. 

Aroha is still regularly monitored so stay tuned during the 2017-2018 breeding season and we will report back with findings.

Aroha's name comes from the Māori word for love.", 'is_featured': False, 'sponsor_name': None, 'sponsor_website': None, 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/aroha/Aroha-crop-c0-52__0-26-500x500-70.JPG', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/aroha/Aroha-crop-c0-52__0-26-350x250-70.JPG', 'full_size': 'https://media.keadatabase.nz/media/birds/aroha/Aroha.JPG'}, 'profile_picture_attribution': None}, 'get_age': 9, 'get_life_stage': 'Adult', 'study_area': 'Waimakariri', 'band_combo': 'Black K on White', 'name': 'Aroha', 'birthday': '2010-01-01', 'primary_band': 'V-2699', 'date_modified': '2018-04-04T11:00:22.219959+12:00', 'date_imported': '2017-06-28T00:21:17.123029+12:00'}

