{'slug': 'schist', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': 'Schist is often at Deaths Corner, the lookout above the Otira Viaduct. Until this year, he hung out there a lot more often than he does these days. 

Schist was banded years ago and fitted with plastic bands "Black C on Yellow". However, he lost one of his plastic leg bands and the other one was so worn due to his habits of scuffing about on the rocks, so his plastic bands were replaced in October 2018 with "Yellow W on Red". 

John Carston from Fab Plastics has generously provided brochure holders for this project to help us get information in huts and ski lodges throughout the South Island.', 'is_featured': False, 'sponsor_name': 'Fab Plastics', 'sponsor_website': 'http://www.fabplastics.co.nz/', 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/schist/Schist_new_bands_Yellow_W_on_Red-crop-c0-55__0-24-500x500-70.jpg', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/schist/Schist_new_bands_Yellow_W_on_Red-crop-c0-55__0-24-350x250-70.jpg', 'full_size': 'https://media.keadatabase.nz/media/birds/schist/Schist_new_bands_Yellow_W_on_Red.jpg'}, 'profile_picture_attribution': 'Klaus Johansen'}, 'get_age': 8, 'get_life_stage': 'Adult', 'study_area': 'Waimakariri', 'band_combo': 'Yellow W on Red', 'name': 'Schist', 'birthday': '2011-01-01', 'primary_band': 'V-1521', 'date_modified': '2018-04-04T11:00:40.405751+12:00', 'date_imported': '2017-06-28T00:21:31.155678+12:00'}

{'slug': 'eva', 'status': 'Alive', 'sex': 'Female', 'bird_extended': {'description': 'Eva is a lovely, dainty little adult female who was banded in 2010. She tends to hang at Deaths Corner occasionally and in 2017 she had at least one chick (Tuhura) who she feeds, preens and chases away occasionally when he starts to bug her too much!

Eva's profile photo shows that she has the older metal bands on her legs. Two of these used to be coated in coloured paint in a unique combintation of colours (in this case Black / Red) but over time this paint fades. It is still extremely helpful if you can take a close-up photo of the metal leg bands because sometimes we are able to read the V band number (the number on the plain metal band - in Eva's case V-0001) and also look closely in the grooves of the ex-painted metal bands to see the remnants of the paint colours there and work out which kea this is! 

We just "re-discovered" Eva in October 2017. Help us be a detective and find more of the older kea with metal leg bands which we haven't seen for ages!', 'is_featured': False, 'sponsor_name': None, 'sponsor_website': None, 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/eva/Eva_metal_leg_bands-crop-c0-5__0-5-500x500-70.jpg', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/eva/Eva_metal_leg_bands-crop-c0-5__0-5-350x250-70.jpg', 'full_size': 'https://media.keadatabase.nz/media/birds/eva/Eva_metal_leg_bands.jpg'}, 'profile_picture_attribution': 'Di Cowan'}, 'get_age': 9, 'get_life_stage': 'Adult', 'study_area': 'Waimakariri', 'band_combo': 'x / Metal - Black / Red', 'name': 'Eva', 'birthday': '2010-01-01', 'primary_band': 'V-0001', 'date_modified': '2018-09-28T10:28:41.359688+12:00', 'date_imported': '2017-06-28T00:21:21+12:00'}

