{'slug': 'celmisia', 'status': 'Dead', 'sex': 'Female', 'bird_extended': {'description': 'Laura, Renny and Mark banded and attached a transmitter to Celmisia below Mt. Foweraker in January 2017. Unfortunately two months later her signal was giving out the mortality double beep and this was tracked to her remains. These were analysed for predator saliva and came back positive for cat. This is the first definite evidence of predation by cats, though it has been suspected for a long time. Two other adult breeding females (Queen Pow Pow and How) are now thought  to have been also preyed upon by feral cats. This predation was within 8km of each other and over a period of seven months.

Because she was an adult female, a transmitter was attached so she could be followed (along with others in the valley) to understand what kea breeding success is like, what the threats to kea are and much more (ongoing work by DOC and KCT, carried out by the kea team).

Celmisia is the scientific name for our beautiful New Zealand daisy.', 'is_featured': False, 'sponsor_name': None, 'sponsor_website': None, 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/celmisia/Celmisia2-crop-c0-5__0-5-500x500-70.JPG', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/celmisia/Celmisia2-crop-c0-5__0-5-350x250-70.JPG', 'full_size': 'https://media.keadatabase.nz/media/birds/celmisia/Celmisia2.JPG'}, 'profile_picture_attribution': 'Mark Brabyn'}, 'get_age': None, 'get_life_stage': None, 'study_area': 'Waimakariri', 'band_combo': 'White W on Orange', 'name': 'Celmisia', 'birthday': '2013-01-01', 'primary_band': 'V-1514', 'date_modified': '2018-04-04T11:00:26.395009+12:00', 'date_imported': '2017-06-28T00:21:37.735796+12:00'}

