Celmisia is the scientific name for our beautiful New Zealand daisy.', 'is_featured': False, 'sponsor_name': None, 'sponsor_website': None, 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/celmisia/Celmisia2-crop-c0-5__0-5-500x500-70.JPG', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/celmisia/Celmisia2-crop-c0-5__0-5-350x250-70.JPG', 'full_size': 'https://media.keadatabase.nz/media/birds/celmisia/Celmisia2.JPG'}, 'profile_picture_attribution': 'Mark Brabyn'}, 'get_age': None, 'get_life_stage': None, 'study_area': 'Waimakariri', 'band_combo': 'White W on Orange', 'name': 'Celmisia', 'birthday': '2013-01-01', 'primary_band': 'V-1514', 'date_modified': '2018-04-04T11:00:26.395009+12:00', 'date_imported': '2017-06-28T00:21:37.735796+12:00'}

{'slug': 'romano', 'status': 'Alive', 'sex': 'Male', 'bird_extended': {'description': 'Romano was banded at Deaths Corner near Arthur's Pass as a fledgling in January 2015. We recently got the below information about Romano from Joseph Peter indicating a migration of 96km. This is exactly what this project is about:

"One thing that was interesting is the banded bird there (red * on white) I had a nice encounter with in Gunn Basin area (Whataroa catchment, him and his friends destroyed my tent haha) and I then saw the same bird (I think) quite some distance away on the northern side of Adams range about one month later. Was quite cool to see them travel such a distance. Is this normal for younger birds? He was in a much smaller group of about 5 birds in the Adams range where as he was part of about 15 or so birds (mainly young) in Gunn Basin. This was April-May 2015."

It is normal for younger birds to form juvenile flocks and disperse this sort of distance. When they reach breeding age (3-4 years) they usually find a mate for life and settle in an area and stay within 10 km.', 'is_featured': False, 'sponsor_name': None, 'sponsor_website': None, 'profile_picture': {'large': 'https://media.keadatabase.nz/media/__sized__/birds/romano/Romano-crop-c0-5__0-5-500x500-70.JPG', 'thumbnail': 'https://media.keadatabase.nz/media/__sized__/birds/romano/Romano-crop-c0-5__0-5-350x250-70.JPG', 'full_size': 'https://media.keadatabase.nz/media/birds/romano/Romano.JPG'}, 'profile_picture_attribution': 'Joseph Peter'}, 'get_age': 4, 'get_life_stage': 'Adult', 'study_area': 'Waimakariri', 'band_combo': 'Red * on White', 'name': 'Romano', 'birthday': '2015-01-01', 'primary_band': 'V-1614', 'date_modified': '2018-04-04T11:00:39.654112+12:00', 'date_imported': '2017-06-28T00:21:30.469420+12:00'}

